	(1, 'Nosotros', 'Nós', '<p><span style="white-space-collapse: preserve; text-align: var(--bs-body-text-align);"><font color="#ffffff" style="">Fibras Argentinas S.A. produce fibras manufacturadas de poliéster a partir de escamas de plásticos PET provenientes de botellas recicladas, consolidándose asi como uno de los principales proveedores del país.</font></span></p><font color="#ffffff"><span data-metadata="<!--(figmeta)eyJmaWxlS2V5Ijoid3dVSWhzaXg2U21kRmgzN2ZMN2drdSIsInBhc3RlSUQiOjEwNTE5OTg1ODksImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->" style=""></span></font><p><span style="white-space-collapse: preserve; text-align: var(--bs-body-text-align);"><font color="#ffffff">Nos encontramos en Quilmes, Provincia de Buenos Aires, con una planta industrial de 30.000 metros cuadrados y la última tecnología en líneas de producción de fibras  de poliéster</font></span><font color="#ffffff" style=""><span style="white-space-collapse: preserve;"> la avanzada en la investigación, el desarrollo, y la puesta en marcha de nuevas tecnologías para el tratamiento de superficies; manifestando una marcada vocación de para el desarrollo de la industria nacional.</span></font><br></p><p><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjEwOTExMjg2MzEsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->"></span></p>', '<div><font color="#ffffff">Fibras Argentinas S.A. produz fibras de poliéster manufaturadas a partir de flocos de plástico PET provenientes de garrafas recicladas, consolidando-se como um dos principais fornecedores do país.</font></div><div><font color="#ffffff"><br></font></div><div><font color="#ffffff">Estamos localizados em Quilmes, província de Buenos Aires, com uma planta industrial de 30.000 metros quadrados e tecnologia de ponta em linhas de produção de fibras de poliéster, pesquisa avançada, desenvolvimento e implementação de novas tecnologias para o tratamento de superfícies; expressando uma marcada vocação para o desenvolvimento da indústria nacional.</font></div>', 'fotos/9FPu3HAoXZRYVnKD8ZS8VWzMfIsg06vANrvqmifb.png', 'undefined', 'undefined', 'home', '2024-06-03 19:02:50'),
	(2, 'Quiénes somos', 'Quem somos', '<p><span data-metadata="<!--(figmeta)eyJmaWxlS2V5Ijoid3dVSWhzaXg2U21kRmgzN2ZMN2drdSIsInBhc3RlSUQiOjUxMTk4MDMwOCwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->"></span><span data-metadata="<!--(figmeta)eyJmaWxlS2V5Ijoid3dVSWhzaXg2U21kRmgzN2ZMN2drdSIsInBhc3RlSUQiOjUxMTk4MDMwOCwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space-collapse: preserve;">Fibras Argentinas S.A. produce fibras manufacturadas de poliéster a partir de escamas de plásticos PET provenientes de botellas recicladas, consolidándose asi como uno de los principales proveedores del país.</span></p><p><span style="white-space-collapse: preserve;">Nos encontramos en Quilmes, Provincia de Buenos Aires, con una planta industrial de 30.000 metros cuadrados y la última tecnología en líneas de producción de fibras  de poliéster</span></p><p><span style="white-space-collapse: preserve;">Contamos con una capacidad productiva de 20.000 toneladas anuales y en múltiples formatos de fibras. 1,5D 3D 7D 15D. </span></p><p><span style="white-space-collapse: preserve;">Fibras huecas o macizas, con o sin silicona, rectas o conjugadas, todas en diferentes longitudes según la necesidad de nuestros clientes permitiendonos cumplir con las demandas de los diferentes sectores y mercados a nivel nacional e internacional.</span><br></p><p><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiUzh4cFJxSmNsY3pDWGNRcFo0ckQxbSIsInBhc3RlSUQiOjY5NzU5NDIxOCwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->"></span></p>', '<p>Fibras Argentinas S.A. produz fibras de poliéster manufaturadas a partir de flocos de plástico PET provenientes de garrafas recicladas, consolidando-se como um dos principais fornecedores do país.</p><p>Estamos localizados em Quilmes, província de Buenos Aires, com uma planta industrial de 30.000 metros quadrados e tecnologia de ponta em linhas de produção de fibras de poliéster.</p><p>Temos capacidade de produção de 20 mil toneladas por ano e em múltiplos formatos de fibra. 1,5D 3D 7D 15D.</p><p>Fibras ocas ou maciças, com ou sem silicone, retas ou conjugadas, todas em diferentes comprimentos de acordo com a necessidade dos nossos clientes, permitindo-nos atender às demandas de diversos setores e mercados a nível nacional e internacional.</p>', 'fotos/ahnif6HKE5NBHQSUjI592nfs8XTKn4fx3lV9z50e.png', 'undefined', 'undefined', 'nosotros', '2024-06-05 15:51:14'),
	(3, 'Formulación y Desarrollo de producto', NULL, '<p><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjc4NDczODY2OCwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->"></span><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjE2NjY4MDczODgsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space-collapse: preserve;">El departamento ejecuta tareas relacionadas con el apoyo técnico y <br>da asesoramiento sobre las características, usos, pruebas y puesta <br>en marcha de cada unos de los producto que sean utilizados por nuestros clientes.<br><br>Los clientes pueden ponerse en contacto con nuestro departamento de Asistencia Técnica "cuando lo consideren necesario" y recibirán asistencia continua hasta la resolución del problema.</span><br></p>', NULL, 'fotos/JvRCk7zuIIzot2h8WMk7XIF2ZuRgPUtASbqFLpOo.png', 'undefined', 'undefined', 'servicio2', '2024-05-29 19:03:48'),
	(4, 'Sobre nosotros', NULL, '<p><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjMxMzMxNzUwLCJkYXRhVHlwZSI6InNjZW5lIn0K(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space-collapse: preserve;">Real Quimica es una empresa de raíz electroquímica y su nombre original al comienzo de sus actividades fue Laboratorio Argentino de Investigación Galvanotécnica.<br>Fundada 1973, su principal objetivo fue el de llevar la avanzada en la investigación, el desarrollo, y la puesta en marcha de nuevas tecnologías para el tratamiento de superficies; manifestando una marcada vocación de para el desarrollo de la industria nacional.<br><br>La innovación tecnológica, la responsabilidad social, la sustentabilidad ambiental y un decidido compromiso en búsqueda de la excelencia para la implementación de sus procesos son las premisas que nos guían.</span><br><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjE4NDQyMDIxODUsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->"></span></p>', NULL, 'fotos/TsaaDKcmaS0oAiE8WJKmKhKqMZtkLEFLk9rHoMF4.png', 'undefined', 'undefined', 'servicio 1', '2024-05-29 18:53:46'),
	(5, 'Laboratorio de calidad', NULL, '<p><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjkzMTk3OTMwLCJkYXRhVHlwZSI6InNjZW5lIn0K(/figmeta)-->"></span><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjk1MDg1NjYwNSwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space-collapse: preserve;">Nuestro laboratorio cuenta con equipamiento de última generación que responde a estrictas normas de calidad y se encuentran al servicio de nuestros clientes.<br><br>Asimismo, contamos orgullosamente con un equipo de profesionales con amplia y destacada experiencia en el desarrollo de productos dirigidos al cuidado de la salud y cosmética capaz de interpretar y entender las necesidades de cada cliente de modo de acompañarlos y sugerirles las mejores alternativas de solución en productos de calidad, rentables y acordes a los lineamientos requeridos.</span><br></p>', NULL, 'fotos/wBKF74ltkSaoIZT43TGi1bKH09HNrNcfLS12q4Qx.jpg', 'fotos/OTTnJeAtU7hcmDuR4U7wMugawafXgXY1cV6OmUFe.txt', 'fotos/dww3d4lJILezUvsI4YqmlLCftrcxQL1rXjfLXL9w.jpg', 'calidad', '2024-05-29 19:12:57');

