INSERT INTO `valores` (`id`, `orden`, `file`, `titulo`, `tituloAlternativo`, `textoAlternativo`, `imagen`, `texto`, `updated_at`, `created_at`) VALUES
	(10, 'bb', NULL, 'Misión', 'Missão', '<div>Profissionalismo e experiência dos nossos colaboradores ao dispor do cliente.</div><div>Aprendizagem contínua e adaptabilidade.</div>', 'fotos/S8BhbKTIP0irTAB32RehdlDta0JGSKeRgrg7YT28.png', '<p><span data-metadata="<!--(figmeta)eyJmaWxlS2V5Ijoid3dVSWhzaXg2U21kRmgzN2ZMN2drdSIsInBhc3RlSUQiOjIwNjk3NDg3NzUsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space-collapse: preserve;">Profesionalismo y experiencia de nuestros empleados a disposición del cliente.<br>Aprendizaje y adaptabilidad continúa.</span><br></p>', '2024-06-05 18:26:11', '2024-06-05 16:42:54'),
	(11, 'bb', NULL, 'Visión', 'Visão', '<p>Identificar e satisfazer as necessidades dos clientes, integrando uma gestão eficiente e a melhoria contínua na comercialização dos nossos fornecimentos e serviços.<br></p>', 'fotos/QwRS9Qq5mTvDeZIEIIbcAA5erkoprMUyT8az64i8.png', '<p><span data-metadata="<!--(figmeta)eyJmaWxlS2V5Ijoid3dVSWhzaXg2U21kRmgzN2ZMN2drdSIsInBhc3RlSUQiOjIwNzUyMjExOTIsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space-collapse: preserve;">Identificar y satisfacer las necesidades de clientes, integrando gestión eficiente y mejora continua en la comercialización de nuestros insumos y servicios.</span><br></p>', '2024-06-05 16:51:45', '2024-06-05 16:48:49'),
	(12, 'cc', NULL, 'Valores', 'Valores', '<p>A disponibilidade permanente dos nossos variados produtos permite-nos enviar com rapidez e precisão para todos os centros de comercialização.<br></p>', 'fotos/ErF8lWiYAcU7v3IY2FYFh4ALgVcq1BhXdwOk5xJJ.png', '<p><span data-metadata="<!--(figmeta)eyJmaWxlS2V5Ijoid3dVSWhzaXg2U21kRmgzN2ZMN2drdSIsInBhc3RlSUQiOjExNDUyMzg4MTEsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space-collapse: preserve;">La disponibilidad permanente de nuestros variados productos, permite enviar en forma rápida y precisa a todos los centros de comercialización.</span><br></p>', '2024-06-05 16:52:43', '2024-06-05 16:52:32');

